import React from 'react';
import './Catalogs.scss';
import { NavLink } from 'react-router-dom';
import Fade from 'react-reveal/Fade';
// import { getPalettes } from '../../util/apiCalls';

const Catalogs = props => {
	console.log(props);
	console.log('hi', this.props.catalogs);
	const catalogsArray = props.catalogs;
	const allCatalog = catalogsArray.map(catalog => {
		const { catalogName, id } = catalog;
		return (
			<NavLink
				key={id}
				exact
				to={`/catalogs/${id}`}
				activeClassName='active-catalog'>
				{' '}
				<li>{catalogName}</li>
			</NavLink>
		);
	});

	// const fetchPalettes = () => {
	// 	catalogs.forEach(async catalog => {
	// 		const palettess = await getPalettes(catalog);
	// 		console.log(palettess);
	// 	});
	// };

	return (
		<section className='Catalogs'>
			<h2>Catalogs</h2>
			<ul>
				<Fade when={props.menuIsActive} delay={200} duration={400} bottom>
					{allCatalog}
				</Fade>
			</ul>
		</section>
	);
};

export default Catalogs;
